// src/components/Home.js
import React from 'react';

function Home() {
  return (
    <div>
      <h1>Hi! I'm Matt, Welcome to My Website</h1>
      <p>This is the homepage of my website, built with React and Django.</p>
      <p>You can navigate to the About Me and To Do List pages using the navigation bar above.</p>
    </div>
  );
}

export default Home;
